import { Component, EventEmitter, Input, Output, SimpleChange } from '@angular/core';
import { CategoryList } from '../apps-ecommerce-category.component';
import { FormBuilder, FormGroup, ReactiveFormsModule, Validators } from '@angular/forms';
import { CommonModule } from '@angular/common';
import { LucideAngularModule } from 'lucide-angular';
import { generateRandomId } from '../../../../../../../Core/shared functions/shared-functions-varibles';
import { ImageUplodingService } from '../../../../../../../service/image-uploding.service';

@Component({
    selector: 'app-cat-add-edit',
    imports: [CommonModule, ReactiveFormsModule, LucideAngularModule],
    templateUrl: './cat-add-edit.component.html',
    styleUrl: './cat-add-edit.component.scss'
})
export class CatAddEditComponent {
  @Input() data!: any;
  @Output() addOrEditedData = new EventEmitter();
  // image = "data:image/png;base64,"

  formGroup!: FormGroup;

  constructor(public fb: FormBuilder, public imgUploading: ImageUplodingService) {
    this.formGroup = this.fb.group({
      category: ['', Validators.required],
      products: [0, [Validators.required]],
      image: ['', Validators.required],
      status: ['', Validators.required],
      description: ['', Validators.required],
      productID: [null]
    });
  }

  ngOnChanges(changes: SimpleChange) {
    if (this.data) {

      this.formGroup.patchValue({
        category: this.data.category,
        products: this.data.products,
        image: this.data.image,  
        status: this.data.status,
        description: this.data.description,
        productID: this.data.productID
      });
      this.formGroup.markAllAsTouched()
    }
  }

  ngOnInit() {
  }

  onFileChange(event: any) {
    this.imgUploading.uploadFile(event).subscribe({
      next: (result) => {
        this.formGroup.get('image')?.setValue(result);
      },
    });
  }

  submit() {
    if (!this.formGroup.valid) {
      return
    }

    let data = this.formGroup.value;
    data ={
      ...data,
      productID: data.productID ? data.productID : generateRandomId('Cpt')
    }
    this.addOrEditedData.emit(data);
    this.reset()
  }

  reset() {
    this.formGroup.reset()
  }
}
